const LoginForm = () => {
    return (
        <form>
            <label for="firstname">Firstname: </label>
            <input type="text" id ="firstname" name="firstname"></input><br></br>
            <label for="lastname">Lastname: </label>
            <input type="text" id="lastname" name="lastname"></input>
        </form>
    )
}

export default LoginForm;
